INSERT INTO `` (`Count`,`제주어`,`표준어`) VALUES (438,'경ᄒᆞ곡 ᄋᆢ름엔양 , 상추도 잇곡 , 물웨도 잇곡 ᄒᆞ민 여름엔 반찬이 좋읍니다 . 우리 물웨가 주루 먹어집니다 . 물웨 , 물웨 뒌장 ᄌᆞᆨ앙 , 또 물웨 국도 ᄒᆞ영 먹곡 , 물웨 ᄄᆞ로 김치도 ᄒᆞ영 먹곡 , 물웨 하영 우영의 해 놓으민양 , 물웨 김치가 경 맛 좋읍니다 . 물웨 솔솔 벳겨둬그네 그자 양념ᄒᆞ영 확 버무리민 그 시간에 먹어 경 좋읍니다','그리고 여름에는요 , 상추도 있고 , 물외도 있고 하면 여름엔 반찬이 좋습니다 . 우리 물외가 주로 먹어집니다 . 물외 , 물외 된장 찍어서 , 또 물외 국도 해서 먹고 , 물외 따로 김치도 해서 먹고 , 물외 많이 텃밭에 해 놓으면요 , 물외 김치가 그렇게 맛 좋습니다 . 물외 솔솔 벗겨서 그저 양념해서 확 버무리면 그 시간에 먹어 그렇게 좋습니다 .');
