INSERT INTO `` (`Count`,`제주어`,`표준어`) VALUES (446,'그거를 막 퍼가지고 이젠 쌀 내와근엥에 그거 막 자꾸 봐야 허여 . 맷돌에서 돌리민 후허게 불엉 보민 다 까지면은 .','그거를 마구 까불어가지고 이젠 쌀 내서 그거 마구 자꾸 봐야 해 . 맷돌에서 돌리면 후하게 불어서 보면 다 깨지면 .');
