INSERT INTO `` (`Count`,`제주어`,`표준어`) VALUES (448,'내 자식이 공부 잘허게 허기 위헤서는 딴 사람네 자식 . 딴 사람네 자식을 공부 잘하게끔 여건을 만들어 줘야 내 자식도 공부 잘 허겟다는 그런 심리로 거 외람뒌 말이지만은 자녀 교육에 대헤서 나한테 자문 구하러 온 학부형들도 많아 .','내 자식이 공부 잘하게 하기 위해서는 딴 사람네 자식 . 딴 사람네 자식을 공부 잘하게끔 여건을 만들어 줘야 내 자식도 공부 잘 하겠다는 그런 심리로 . 거 외람된 말이지만은 자녀 교육에 대해서 나한테 자문 구하러 온 학부형들도 많아 .');
INSERT INTO `` (`Count`,`제주어`,`표준어`) VALUES (449,'남으니까 그디 헷다가 허면은 그거 건즘 때면은 불채 저레 불채통이 라고 헤서 거 또 ᄋᆢᇁ이는 불채만 내크는 디가 잇고 , ᄒᆞᆫ쪽에는 ᄀᆞ시락 놓곡 그렇게 헤서 허면은 오ᄌᆞᆷ단지 무뚱에 놔서 오줌을 싸노민은 그 오줌을 불채드레 강 비우거든 . 불채에 강 비와야 걸거든 . 오줌이 질소 오줌오자 요소거든예 . 요소나 만찬가지 라 그러면 그 불채는 주로 어디다 잘 쓰는고 허니까 메멀농사 헐 때 메멀농사를 잘 써 .','남으니까 거기 했다가 하면 그거 거의 때면 재 저기 재통이라고 해서 거 또 옆에는 재만 내치는 데가 있고 , 한쪽에는 까끄라기 놓고 그렇게 해서 하면 오줌단지 문앞에 놔서 오줌을 싸놓으면 그 오줌을 재에 가서 비우거든 . 재에 가서 비워야 걸거든 오줌이 질소 오줌오자 요소거든요 . 요소나 만찬가지야 . 그러면 그 재는 주로 어디다 잘 쓰는가 하니까 메밀농사 헐 때 메밀농사를 잘 써 .');
