INSERT INTO `` (`Count`,`제주어`,`표준어`) VALUES (764,'셋삼춘 , 셋아방은 펫병 , 옛날은 펫병 들엉 일허레 못 가민 약을 딸리 렌 허지 . 탄약 헹 딸리젠 허민 화리에 숫불을 살뢍 딸리민 ᄒᆞ루 두 첩 딸리고 , 따시 두 첩 ᄒᆞᆫ듸 약 헤어놩 , 세 번을 딸리민 그거 ᄒᆞ루 , ᄒᆞᆫ ᄋᆢ답 시 전이 , ᄒᆞᆫ 일곱 시 전이 그 약을 다 딸리민 약을 잘 딸렷젠 허멍 , 날ᄀᆞ라 . 경 다 헤도 셋아방은 경헹 약 딸리고 말을 잘 들으난 , 두린 때도 말을 잘 들으난 , 난 미진 안허여 .','둘째삼촌 , 둘째아버지는 폐병 , 옛날은 폐병 들어서 일하러 못 가면 약을 달이라고 하지 . 탕약 해서 달이려고 하면 화로에 숯불을 살려서 달이면 하루 두 첩 달이고 , 다시 두 첩 함께 약 해놓고 , 세 번을 달이면 그거 하루 , 한 여덟 시 전에 , 한 일곱 시 전에 그 약을 다 달이면 약을 잘 달였다고 하면서 , 나보고 . 그렇게 다 해도 둘째아버지는 그렇게해서 약 달이고 말을 잘 들으니까 , 어릴 때도 말을 잘 들으니까 , 난 미워하지 않아 .');
