INSERT INTO `` (`Count`,`제주어`,`표준어`) VALUES (785,'경허민 큰 시리 떡 치는 큰 시리 헤여근에 그 콩을 졸라근에 막 콩 ᄌᆞᆫᄌᆞᆫ헌 거 졸랑 허민 그 건져근에 이제 물 빠지왕 그 시리 아래 검질 아 레 비와 놔근에 장태나 무시거 받쳥 방안에 놩 이불이나 무시거 폭 덮엉 놔두민 그 콩이 보실보실 나주게 . 나민 그엔 자꾸 물을 줴야 혀 . 물 안 주민 발 ᄃᆞᆮ지 안헤영 물을 잘 줘야 콩을 곱게 크주 . 콩지름 못 키우는 사름 물을 안 줭 못 키와 .','그러면 큰 시루 떡 찌는 큰 시루 해서 그 콩을 골라서 막 콩 잔잔한 거 골라서 하면 그 건져서 이제 물 빼서 그 시루 아래 김 깔아서 그리 부어 놔서 장태나 뭐 받쳐서 방안에 놔서 이불이나 뭐 푹 덮어서 놔두면 그 콩이 보실보실 나지 . 나면 거기에 자꾸 물을 줘야 해 . 물 안 주면 발 나오지 않아서 물을 잘 줘야 콩이 곱게 크지 . 콩나물 못 키우는 사람 물을 안 줘서 못 키워 .');
