INSERT INTO `` (`Count`,`제주어`,`표준어`) VALUES (986,'자리물훼는 이 보민 ᄉᆞᆯ지는 따문에 우리도 ᄒᆞᆫ 해에 자리물훼 멧 번 먹엄수다게 사당 집잇어 ᄒᆞ영 먹어 . 집의 제피도 싯곡 , 미나리도 싯곡 , 저 세우리도 싯곡 ᄒᆞ민 집의 거 다 놓민 자리물훼 뒈마씀 . 영 ᄒᆞ영 죽장 행 자리물훼 사당 , 강 사다그네 행 .','자리물회는 이 보면 살찌는 때문에 우리도 한 해에 자리물회 몇 번 먹고 있습니다 . 사다가 집에서 초피도 있고 , 미나리도 있고 , 저 부추도 있고 하면 집에 거 다 넣으면 자리물회 돼요 . 이렇게 해서 줄곧 해서 자리물회 사다가 , 가서 사다가 해서 .');
